import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav style={styles.navbar}>
            <ul style={styles.navList}>
                <li style={styles.navItem}>
                    <Link to="/add-event" style={styles.navLink}>Add Event</Link>
                </li>
                <li style={styles.navItem}>
                    <Link to="/view-events" style={styles.navLink}>View Events</Link>
                </li>
            </ul>
        </nav>
    );
}

const styles = {
    navbar: {
        backgroundColor: 'green',
        padding: '10px 20px',
        textAlign: 'center',
    },
    navList: {
        listStyle: 'none',
        padding: 0,
    },
    navItem: {
        display: 'inline',
        marginRight: '20px',
    },
    navLink: {
        color: 'white',       // Set the font color to white
        textDecoration: 'none',  // Remove underline from links
    }
};

export default Navbar;
